export const commandsList = [
    {
        name: ["Bold", "bold", "b"],
        execute: () => console.log('Executing Bold command'),
    },
    {
        name: "Italicize",
        execute: () => console.log('Executing Italicize command'),
    },
    {
        name: "Strikethrough",
        execute: () => console.log('Executing Strikethrough command'),
    },
    {
        name: "Heading1",
        execute: () => console.log('Executing Heading1 command'),
    },
];
